CREATE TABLE POTENTIAL_LEADS(
  "ID" varchar(100),
  "AGE_OF_BUSINESS" varchar(100),
  "CITY" varchar(100),
  "COMPANY" varchar(100),
  "CONVERTED_DATE" varchar(100),
  "CONVERTED_LEAD_ID" varchar(100),
  "COUNTRY" varchar(100),
  "AREA" varchar(100),
  "EMPLOYEE_COUNT" varchar(100),
  "INDUSTRY" varchar(300),
  "PHONE" varchar(100),
  "POTENTIAL_LEAD_LOCATION__LATITUDE__S" varchar(100),
  "POTENTIAL_LEAD_LOCATION__LONGITUDE__S" varchar(100),
  "SECTOR" varchar(100),
  "STATE" varchar(100),
  "STATUS" varchar(100),
  "STREET" varchar(100),
  "WEBSITE" varchar(300),
  "ZIP_CODE" varchar(100)
);
CREATE TABLE PURSUED_LEADS(
  ID varchar(100),
  AGE_OF_BUSINESS varchar(100),
  CITY varchar(100),
  COMPANY varchar(100),
  CONVERTED_DATE varchar(100),
  CONVERTED_LEAD_ID varchar(100),
  COUNTRY varchar(100),
  AREA varchar(100),
  EMPLOYEE_COUNT varchar(100),
  INDUSTRY varchar(300),
  PHONE varchar(100),
  POTENTIAL_LEAD_LOCATION__LATITUDE__S varchar(100),
  POTENTIAL_LEAD_LOCATION__LONGITUDE__S varchar(100),
  SECTOR varchar(100),
  STATE varchar(100),
  STATUS varchar(100),
  STREET varchar(100),
  WEBSITE varchar(300),
  ZIP_CODE varchar(100)
);



